DROP TABLE IF EXISTS RICOVERO;
CREATE TABLE IF NOT EXISTS RICOVERO(
   CODospedale      VARCHAR(11) NOT NULL
  ,CODricovero      VARCHAR(18) NOT NULL PRIMARY KEY
  ,PAZIENTEricovero VARCHAR(15) NOT NULL
  ,DATAricovero     VARCHAR(15)  NOT NULL
  ,DURATAricovero   INTEGER  NOT NULL
  ,MOTIVOricovero   VARCHAR(8) NOT NULL
  ,COSTOricovero    VARCHAR(7) NOT NULL
);
